import React from 'react';
import FuncCard from "./components/FuncCard";
import "./App.css"

function App() {
  return (
    <div className="App">
      <nav className="main-nav">
          <a href="/">Wellcome to Components</a>
      </nav>
        <FuncCard />
    </div>
  );
}

export default App;
